import React from "react";
import { PieChart, Pie, Tooltip } from "recharts";

function BudgetChart() {
  const data = [
    { name: "Needs", value: 50 },
    { name: "Wants", value: 50 },
    { name: "Financial Goals", value: 50 },
  ];

  return (
    <div>
       <h1></h1>
      <PieChart width={400} height={400}>
        <Pie
          dataKey="value"
          isAnimationActive={false}
          data={data}
          cx={200}
          cy={200}
          outerRadius={80}
          fill="#8884d8"
          label
        />
        <Tooltip />
      </PieChart>
    </div>
  );
}

export default BudgetChart;
